create table articles(
    id serial primary key ,
    product_id bigint,
    name varchar(100),
    content text,
    created_date date
);
comment on table articles is 'Таблица статей';
create table products(
    id serial primary key ,
    name varchar(100),
    description text,
    implementation_cost bigint
);
comment on table products is 'Таблица продуктов';



